import { useState } from "react"
import {
  Container,
  Grid,
  Typography,
  TextField,
  Button,
} from "@material-ui/core";
import styles from "./Calculator.module.scss";

function Calculator() {
    const [height, setHeight] = useState(0)
    const [weight, setWeight] = useState(0)

  return (
    <div className={styles.calculator}>
      <Container maxWidth="xs">
        <Typography variant="h3">Calculator</Typography>
        <Grid container direction="column" spacing={2}>
          <Grid item>
            <TextField label="Height (cm)" variant="filled" fullWidth type="number" value={height} onChange={(e) => setHeight} />
          </Grid>
          <Grid item>
            <TextField label="Weight (Kg)" variant="filled" fullWidth type="number" value={weight} onChange={(e) => setWeight} />
          </Grid>
          <Grid item>
            <Button variant="contained" color="primary" fullWidth>
              Calculate
            </Button>
          </Grid>
          <Grid item>
              <Typography>O seu IMC Ã©: </Typography>
          </Grid>
        </Grid>
      </Container>
    </div>
  );
}

export default Calculator;
